package main

import "fmt"

/*

给定由 N 个小写字母字符串组成的数组 A，其中每个字符串长度相等。

你需要选出一组要删掉的列 D，对 A 执行删除操作，使 A 中剩余的每一列都是 非降序 排列的，然后请你返回 D.length 的最小可能值。

删除 操作的定义是：选出一组要删掉的列，删去 A 中对应列中的所有字符，形式上，第 n 列为 [A[0][n], A[1][n], ..., A[A.length-1][n]]）。

1 <= A.length <= 100
1 <= A[i].length <= 1000

题解思路：
1、遍历每一个列，如果该列不是非降序的，则D.length+1。
*/

func minDeletionSize(A []string) int {
	res := 0
	for i := 0; i < len(A[0]); i++ {
		flag := false
		for j := 0; j < len(A)-1; j++ {
			//fmt.Println(A[j][i], string(A[j][i]), A[j+1][i], string(A[j+1][i]), A[j][i] >= A[j+1][i])
			if A[j][i] > A[j+1][i] {
				flag = true
				break
			}
		}
		if flag {
			res += 1
		}
	}
	return res
}

func main() {
	var test = []string{"", "", "", "", "", "", "", "", "", "", "", "", "", "", "", "", "", "", "", "", "", "", "", "", "", "", "", "", "", "", "", "", "", "", "", "", "", "", "", "", "", "", "", "", "", "", "", "", "", "", "", "", "", "", "", "", "", "", "", "", "", "", "", "", "", "", "", "", "", "", "", "", "", "", "", "", "", "", "", "", "", "", "", "", "", "", "", "", "", "", "", "", "", "", "", "", "", "", "", ""}
	fmt.Println(minDeletionSize(test))
}
